import React,{useEffect} from 'react';
import ReactGa from 'react-ga'
 function Analytics() {
     const MEASUREMENT_ID = 'G-VGM0BRQBNP'
    useEffect(()=>{
        ReactGa.initialize(MEASUREMENT_ID)
        // report page view
        ReactGa.pageview('/')
    },[])
    return <div>
        Analytics works
    </div>
}

export default Analytics
